import React from "react"

class Message {
    static imageContent(content, className) {
        return (
            <img
                className={className}
                src={"data:image/png;base64," + content}
                alt="image"
            />
        )
    }

    static textContent(content, className) {
        return <p className={className}>{content}</p>
    }
}

export default Message
